import React from 'react';
import QAChat from '../components/QAChat';

const QAPage = () => {
  return (
    <div style={{ minHeight: '100vh', background: '#f9fafb', paddingTop: '2rem' }}>
      <QAChat />
    </div>
  );
};

export default QAPage;
